import React from 'react';
import { BrowserRouter } from 'react-router-dom'
import AppRouter from "./components/AppRouter";
import './App.css';
import ShopNavBar from './components/UI/ShopNavBar/ShopNavBar';


function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <ShopNavBar/>
        <AppRouter/>
      </BrowserRouter>
    </div>
  );
}

export default App;
